import React, { Component } from "react";
import { Grid, Button, Container, IconButton } from "@material-ui/core";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faChevronLeft,
  faChevronRight,
  faBell
} from "@fortawesome/free-solid-svg-icons";

class Home extends Component {
  render() {
    return (
      <div>
        <Container style={{ background: "red" }}>
          <Grid
            container
            direction="row"
            style={{
              alignContent: "center",
              alignItems: "center",
              justifyContent: "space-between",
              height: 400
            }}
          >
            <IconButton>
              <FontAwesomeIcon
                style={{ color: "white" }}
                icon={faChevronLeft}
              />
            </IconButton>
            <IconButton>
              <FontAwesomeIcon
                style={{ color: "white" }}
                icon={faChevronRight}
              />
            </IconButton>
          </Grid>
        </Container>
      </div>
    );
  }
}

export default Home;
